import React, { useState } from 'react'

function NewFile() {
    const [data,setData]=useState([1,2])
    const array=[1,3,4,5];

    const clickHandler=(()=>{
        setData()
    })
    return (
        
      <div>
        
          {
            array.map(index=>{
               <h1>{index}</h1>
                console.log(index)
                // return {index}

                //  console.log(index)
            })}
          <h1 onClick={clickHandler}>{data}fghghnb</h1>
          <h1>Ali Abbas</h1>
         
      </div>
    );
  }
  
  export default NewFile;
